import * as types from "../constants/ActionTypes";

const initialState = {
  contacts: [],
};

const contactReducer = (state = initialState, action) => {
  if (action.type === types.FETCH_CONTACT) {
    state = action.contacts;
    return state;
  } else {
    return state;
  }
};

export default loginReducer;
